<template>
  <StoreBottomSheet>
    <template #title>
      <span class="text-left font-size-16 font-weight-bold mb-2">
        {{ $t('views.orderDetail.untactImageModal.title') }}
      </span>
    </template>
    <template #content>
      <img
        :src="delivery.dropImageUrl"
        class="w-100 mt-4"
        @error="replaceByDefault"
        v-if="!isError"
      />
      <template v-else>
        <div class="d-flex flex-column justify-center align-center my-2">
          <svg width="172" height="172" viewBox="0 0 172 172" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
            <rect width="172" height="172" fill="url(#pattern0)"/>
            <defs>
              <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
                <use xlink:href="#image0_8921_49782" transform="scale(0.00125)"/>
              </pattern> <!-- eslint-disable-next-line -->
              <image id="image0_8921_49782" width="800" height="800" xlink:href="data:image/png;base64,"/>
            </defs>
          </svg>

          <p class="font-weight-bold mb-2">
            {{ $t('views.orderDetail.untactImageModal.cannotLoadImage') }}
          </p>
          <p class="s-color-gray-61">
            {{ $t('views.orderDetail.untactImageModal.contact') }}
          </p>
        </div>
      </template>
    </template>
  </StoreBottomSheet>
</template>

<script>
import { defineComponent, ref, watch } from 'vue';

import errorImage from '@/assets/images/error/loading_error.png';
import StoreBottomSheet from '@/components/common/StoreBottomSheet.vue';

export default defineComponent({
  name: 'UntactImageModal',
  components: {
    StoreBottomSheet,
  },
  props: {
    delivery: {
      type: Object,
      required: true,
    },
  },
  emits: ['close'],
  setup(props, { attrs, emit }) {
    const isError = ref(false);
    // 모달이 닫혔을 때 isError 초기화
    watch(() => attrs.visible, (newValue) => {
      if (!newValue) {
        isError.value = false;
      }
    });
    return {
      replaceByDefault: () => {
        if (!isError.value) {
          isError.value = true;
        }
      },
      isError,
      errorImage,
      closeModal: () => {
        isError.value = false;
        emit('close');
      },
    };
  },
});
</script>

